import { Route, Switch } from 'react-router-dom';
import Home from './pages/Home'
function App() {
  return (
    <div className="flex ">
    <div className="w-0 sm:w-0 lg:w-20">
      <div className="flex-shrink-0 h-screen overflow-hidden bg-primary shadow-nav">
        <h1>ahmed ahmeed</h1>
      </div>
    </div>
    <div className="w-full ">
      <div className="h-screen overflow-y-auto bg-orange-500 ">
      <Switch>

           <Route   path='/' component={Home} />

        </Switch>
      </div>
    </div>

  </div>
  );
}

export default App;
